import { useState } from 'react'
export default function App() {
  const[newItem,setNewItem]=useState();
  
  return (
    <div>
      <h1>to do list</h1>
      <input type='text' onChange={(e)=>setNewItem(e.target.value)}/>
      <button>Add</button>
    </div>
  )
}
